import React from 'react'

const hero = () => {
    return (
        <section className="hero" style={{
            marginTop: "80px",
            display: "flex",
            position: "relative",
            width: "100vw",
            height: "600px"
        }}>
            <img src="../img/bannerHero.jpg" alt="Compra ahora mochilas, valijas y accesorios" style={{
                width: "100vw",
                objectFit: "cover"
            }}></img>
            <div style={{
                display: "flex",
                position: "absolute",
                width: "100%",
                flexFirection: "column",
                alignItems: "center",
                top: "50%"
            }}>
                <h1>Desde 1995 con vos</h1>
                <a href="." target="_blank">Compra ahora</a>
            </div>
        </section>
    )
}

export default hero
